import React from 'react';
import Card from '../Card/Card';
import styles from './Feed.module.css';
import Link from 'next/link';


function Feed({ posts }) {
  return (
    <div>
      <Link>
     { posts.slice(4, 8).map(post => (
        <div className={styles.feed_card}>
          <Card key={post.id} post={post} />
        </div>
      ))}
      </Link>
    </div>
  );
}

export default Feed;
